import React from 'react';
import { Modal } from 'react-bootstrap';

const WorkoutCreateModal = ({ isOpen, handleModalClose }) => {
  return (
    <Modal >
      <Modal.Header>Header modal</Modal.Header>
      <div>Successfully added workout for user !!!</div>
      <button type="button" onClick={handleModalClose}>
        Close Modal
      </button>
    </Modal>
  );
};

export default WorkoutCreateModal;
